import React from 'react';
import ReactDOM from 'react-dom/client';
import {UnityContextProvider} from 'react-unity-webgl';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <UnityContextProvider>
        <App />
    </UnityContextProvider>
);
